import React from 'react';
import styles from './banner.module.css'
import { ParallaxP } from 'react-scroll-parallax';

const back = "https://images.unsplash.com/photo-1526726538690-5cbf956ae2fd?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTF8fGNhcnN8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60"


// document.body.style.textAlign="center";


function banner() {
    return (

        <Parallax bgImage={back} strength={250}>

            <div className={styles.bg_container}>
            <p className={styles.bg_p}> "Are you stuck , use Mechanical Delivery" </p>          
            </div>

        </Parallax>
    )
}

export default banner
